INSERT INTO `catalog_pages` VALUES ('24', '351', 'Ikkunat', '0', '63', '1', '1', '1', '0', '-1', 'default_3x3', 'ctlg_windows_headline1_en', 'ctlg_windows_teaser1_en', 'catalog_special_txtbg2', 'Let some light in! Our windows come in many unique styles to give an exciting look to your room. Buy landscapes to go with your windows from the \'Spaces\' page!', '', 'Click on an item for more information.', 'Ooh, new view!', '0', '', '');
