INSERT INTO `catalog_pages` VALUES ('29', '351', 'Teleportit', '0', '58', '1', '1', '1', '0', '-1', 'default_3x3', 'catalog_doors_headline1', 'catalog_teaser_teleporters', 'catalog_special_txtbg1', 'Take your room to a whole new level with our range of space age teleporters! Just buy a pair, put one in each room and voila! You\'ll have two linked rooms!', '', 'Click on an item for more information.', 'Take your room to the next level!', '0', '', '');
INSERT INTO `catalog_pages` VALUES ('30', '351', 'Polyfon', '0', '39', '1', '1', '1', '0', '-1', 'default_3x3', 'catalog_mode_headline1', 'catalog_mode_teaser1', 'catalog_special_txtbg2', 'Steely, grey, industrial standard metal with a sleek design. The perfect range for a streetwise city dweller.', '', 'Click on an item for more information.', 'So shiny and new..', '0', '', '');
INSERT INTO `catalog_pages` VALUES ('31', '351', 'Candy', '0', '19', '1', '1', '1', '0', '-1', 'default_3x3', 'catalog_candy_headline1', 'catalog_candy_teaser1', 'catalog_special_txtbg2', 'A bit more feminine than \'Mode\', this will add a bit of glamour and glitz to your rooms. Lacking a few items? Head on over to the \'Mode\' category!', '', 'Click on an item for more information.', 'lol I killed a pink bear for this rug!', '0', '', '');
INSERT INTO `catalog_pages` VALUES ('32', '351', 'Pura', '0', '48', '1', '1', '1', '0', '-1', 'default_3x3', 'puraheader', 'catalog_pura_teaser1', 'catalog_special_txtbg2', 'The cleanest, freshest range. You can almost hear it breathe cool and tranquility within your room. Use it to create a haven away from the hectic lifestyle of Wabbo Hotel.', '', 'Click on an item for more information.', 'So many colors!', '0', '', '');
INSERT INTO `catalog_pages` VALUES ('33', '351', 'Armas', '0', '14', '1', '1', '1', '0', '-1', 'default_3x3', 'catalog_area_headline1', 'catalog_area_teaser1', 'catalog_special_txtbg2', 'A chunky and sofisticated line for the down-to-earth, studious Wabbo. Its simplicty is beautful and will add a welcoming charm to every room.', '', 'Click on an item for more information.', 'Beautiful in it\'s simplicity! ', '0', '', '');
INSERT INTO `catalog_pages` VALUES ('34', '32424', 'Kantri', '0', '21', '1', '1', '1', '0', '-1', 'default_3x3', 'country_header1_en_001', 'country_teaser1', 'catalog_special_txtbg2', 'Let\'s leave the busy city streets and head over to the wide abyss of golden wheat, emerald fields and home grown, organic vegetables. Everything you need to create a farm!', '', 'Click on an item for more information.', 'Who\'d be a crow, eh?', '0', '', '');
INSERT INTO `catalog_pages` VALUES ('35', '351', 'Armas', '0', '37', '1', '1', '1', '0', '-1', 'default_3x3', 'catalog_lodge_headline1', 'catalog_lodge_teaser1', 'catalog_special_txtbg2', 'For that splendid ski-lodge effect with an open fire and whisky on the sidebar. This range is for those who appreicate the true beauty of solid wood.', '', 'Click on an item for more information.', 'I liek wood!', '0', '', '');
INSERT INTO `catalog_pages` VALUES ('36', '351', 'Plastic', '0', '46', '1', '1', '1', '0', '-1', 'plasto', 'catalog_plasto_headline1', '', '', 'Throw on an afro and grab a disco ball! Feel that retro, 1970s vibe? You soon will with this colourful, plastic range! Choose a colour to suit your mood and off you go!', '', 'Click on an item for more information.', '', '0', '', '');
INSERT INTO `catalog_pages` VALUES ('38', '351', 'Kylpyhuone', '0', '17', '1', '1', '1', '0', '-1', 'default_3x3', 'catalog_bath_headline1', 'catalog_bath_teaser1', 'catalog_special_txtbg2', 'Lets face it.. you can\'t live without your bathroom. Give your guests somewhere to freshen up with our cheeful bathroom collection!', '', 'Click on an item for more information.', 'Every Wabbo needs one!', '0', '', '');
INSERT INTO `catalog_pages` VALUES ('39', '351', 'Kasvit', '0', '45', '1', '1', '1', '0', '-1', 'default_3x3', 'catalog_plants_headline1', 'catalog_plants_teaser1', 'catalog_special_txtbg2', 'Every room needs some greenery, dear! Not only do they enhance the air quality, they cheer up a room to make it simply splendid! And what better gift for a friend than an elegant rose..', '', 'Click on an item for more information.', 'I\'m a tree!', '0', '', '');
INSERT INTO `catalog_pages` VALUES ('40', '351', 'Matot', '0', '52', '1', '1', '1', '0', '-1', 'default_3x3', 'catalog_rugs_headline1', 'catalog_rugs_teaser1', 'catalog_special_txtbg2', 'Rugs for all occasions, white for weddings, black for funerals and everything in between! All rugs are non-slip and machine washable. Take your pick!', '', 'Click on an item for more information.', 'This\'ll be perfect in my room!', '0', '', '');
INSERT INTO `catalog_pages` VALUES ('41', '351', 'Galleria', '0', '47', '1', '1', '1', '0', '-1', 'default_3x3', 'catalog_gallery_headline1', 'catalog_posters_teaser1', 'catalog_special_txtbg2', 'Adorn your walls with posters, art, plaques and wall hangings. This gallery is bursting with items to suit all tastes, traditional and modern!', '', 'Click on an item for more information.', 'Brighten up your walls!', '0', '', '');
INSERT INTO `catalog_pages` VALUES ('42', '351', 'Pokaalit', '0', '60', '1', '1', '1', '0', '-1', 'trophies', 'catalog_trophies_headline1', '', '', 'Send one to your friend to show appreciation!', '', 'Click on an item for more information.', '', '0', '', '');
